    render() {
        return (
            <FormControl margin="normal">
                <form onSubmit={this.props.addItem}>
                    <Input />

                    <Button color="primary" 
                    variant="contained" type="submit">Add To Cart </Button>

                </form>

            </FormControl>
        )
    }
}

export default CartAdder
